Hurricane Katrina was a devastating Category 5 Atlantic hurricane that resulted in 1,392 fatalities and caused damage late August 2005, particularly in the city of New Orleans and its surrounding areas.

 @magnolialevee speaks on how although it was a life threatening moment for the city of New Orleans it was also a good thing for his life, speaks on being shot before Katrina took place.

Episode drops Tonight at 5pm on @youtube
